import React from 'react';
import { AppBar, Grid, Toolbar, Typography } from '@material-ui/core';

const Footer = () => {
    return ( 
      <AppBar position="static">
          <Toolbar>
              <Typography>
                  All rights reserved.
              </Typography>
          </Toolbar>
      </AppBar>
    );
}
 
export default Footer;
